webpackJsonp([35943344896977],{6574:function(e,t){e.exports={data:{post:{html:'<p>Chrismas isn\'t even over yet, but we are already getting ready for the next <a title="PapaScott : Christopher Ryan Hanson" href="http://www.papascott.de/1999/12/27/">big event</a>. As has been our tradition for the past 4 years, we will once again have <a title="PapaScott : Birthing Christopher" href="http://www.papascott.de/1999/12/30/">goose dinner</a> on December 26th. This year we have a goose breast, with red cabbage from the freezer, and potatoes for the non-Atkins eaters. And we have a story to tell to Christopher.</p>',fields:{title:"Goose Dinner",date:"26 Dec 2003",url:"https://papascott.de/2003-12-26-goose-dinner/"}}},pathContext:{slug:"/2003-12-26-goose-dinner/",prev:{fields:{title:"Santa Has Landed",date:"24 Dec 2003",slug:"/2003-12-24-santa-has-landed/"}},next:{fields:{title:"Big Day",date:"27 Dec 2003",slug:"/2003-12-27-big-day/"}}}}}});
